  display: inline-flex;
  align-items: center;

  background: transparent;
  border: 0;
  outline: none;

.ant-tabs-tab-remove:active {
  color: #096dd9;

  outline: none;
  transition: all 0.3s;
}
.ant-tabs-tab-remove {
  flex: none;
  margin-right: -4px;
  margin-left: 8px;
  color: rgba(0, 0, 0, 0.45);

  border: none;

  margin: 0;
}
.ant-tabs-tab .anticon {
  margin-right: 12px;
}
.ant-tabs-tab + .ant-tabs-tab {
  margin: 0 0 0 32px;

.ant-tabs-content {

  width: 100%;

.ant-tabs-content-holder {

.ant-tabs-tabpane {
  flex: none;
  width: 100%;

/* ant td card */
.ant-card-meta-title {
  white-space: normal !important;
  text-align: left;
}
.ant-card-bordered {
  margin: 0 auto;
  width: 100% !important;
  border-radius: 20px;
}
.ant-card-cover img {
  border-radius: 20px 20px 0 0;
}
/* Home product size radio css antd */
.ant-radio-button-wrapper:not(:first-child)::before {
  width: 0 !important;
}
/*homepage product change tab */
.ant-tabs-ink-bar {
  position: absolute;
  background: black;
  pointer-events: none;
}
.ant-tabs-tab.ant-tabs-tab-active .ant-tabs-tab-btn {
  color: black;
  text-shadow: 0 0 0.25px currentcolor;
}
/* filter collection antd select  */
.ant-select:not(.ant-select-customize-input) .ant-select-selector {
  border-radius: 50px;
  height: 40px;
  align-items: center;
}
.ant-select-dropdown {
  border-radius: 20px;
}

.size-product-btn {
  background-color: #fff;
  color: black;
  font-weight: 800;
  border-radius: 14px !important;
  height: 42px;
  width: 48px;
  line-height: 44px;
  border: none !important;
  margin: 0 4px;
}
.size-product-btn:hover {
  background-color: black;
}
.ant-radio-button-wrapper:focus-within {
  box-shadow: none;
}
.size-product-btn:hover span {
  color: #fff;
}
